import { useEffect } from "react";

import axios from "axios";
import * as cheerio from "cheerio";

function App() {
  useEffect(() => {
    async function enterCodeforces() {
      let base: string = "https://codeforces.com";
      let cf_enter: string = base + "/enter";

      const response = await axios
        .get("https://web-scraping.dev/product/1")
        .then(function (response) {
          response.setHeader("Access-Control-Allow-Origin", "*");
          console.log(response);
        })
        .catch(function (error) {
          console.log(error);
        });
    }
    enterCodeforces();
  }, []);

  return <main></main>;
}

export default App;
